import React, { Component } from 'react';
import { CardGroup } from 'react-bootstrap';
import ProductListingComponent from './ProductListing.component';
import productData from '../data/product.json';

class ProductListing extends Component {
	render() {
		console.log(productData);
		const productList = productData.Products.map((product, index) => {
			return (
				<ProductListingComponent
					key={index}
					imgsrc={product.imgUrl}
					productTitle={product.name}
					price={product.price}
					desc={product.description}
					addtoCartHandler={this.props.cartCountUpdater}
				/>
			);
		});

		return <CardGroup>{productList}</CardGroup>;
	}
}

export default ProductListing;
